		<p><strong>&nbsp;</strong></p>
<p><strong>Fabrication Man-hours</strong><b style="color: #000000; font-family: Times; font-size: medium; line-height: normal;">&nbsp;</b></p>
<ul>
<li>Fabrication man-hours are determined by the quantity of hours/tasks in each steel assembly, for example, each column, beam, brace, assembly, or bracket.</li>
<li>The average constants are for high repetition portal frame and high rise type work. The ranges are for differences in piece size, detail, repetition, and fabrication methods.</li>
<li>These constants are based on conventional fabrication methods used by most fabricators, ie manual gas cutting and magnetic broach drilling, and semi-automatic "mig" or "flux core" welding.</li>
<li>With semi-automated saw and drill lines output is much higher but machine costs are higher, and generally the market does not differentiate costs because semi-automation affects only part of overall fabrication.</li>
<li>The constants include for reading fabrication drawings, stacking and sorting materials, marking out, turning, grinding edges and welds, operator setting up, servicing gear such as welders and grinders, and QA including average rework.</li>
<li>These constants are "whole of job", and hence will differ from spot check times which will not be representative of a complete job due to the tendancy not to include downtime and variances in productivity.</li>
<li>Repetition affects productivity in different ways, and for some labour operations can have a significant impact on output, while other labours produce only slight improvements. A high degree of difficulty can also have a large impact on output, for example, very detailed drawings, angled assembly, low repetition of detail, complex set out.</li>
</ul>
<p style="color: #000000; font-family: Times; font-size: medium; line-height: normal; text-align: left;">&nbsp;</p>
